// 数组去重
function unique(arr) {
    var newArr = [];//新建一个数组
    for (var i = 0, len = arr.length; i < len; i++) {
        if (newArr.indexOf(arr[i]) == -1) {//若新数组中未包含该项则将其存入新数组
            newArr.push(arr[i]);
        }

    }
    return newArr;

}

// 当前城市省市编码
function localCodeInfo(city){
    var cityCode="";

    for (var  i in cityObjs){
        if(cityObjs[i].city==city){
            cityCode=cityObjs[i].cityCode;
            break;
        }
    }
    // console.log('cityCode:', city)
    return cityCode;
  
}
